INSERT INTO `wp_posts` VALUES (1,1,'2018-03-29 12:15:34','2018-03-29 12:15:34','An<em>application</em>that runs stand-alone in a<em>desktop</em>or laptop computer. Contrast with \"Web-based<em>application</em>,\" which requires the Web browser to run. The term may be used to contrast<em>desktop applications</em>with mobile<em>applications</em>that run in smartphones and tablets.','Desktop Application','','publish','open','open','','hello-world','','','2018-03-30 06:18:30','2018-03-30 06:18:30','',0,'http://localhost/portfolio/?p=1',0,'post','',1),(2,1,'2018-03-29 12:15:34','2018-03-29 12:15:34','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/portfolio/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2018-03-29 12:15:34','2018-03-29 12:15:34','',0,'http://localhost/portfolio/?page_id=2',0,'page','',0),(4,1,'2018-03-29 12:22:13','2018-03-29 12:22:13','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Desktop Application','','inherit','closed','closed','','1-autosave-v1','','','2018-03-29 12:22:13','2018-03-29 