portfolio/wp-content/uploads/2018/03/web-design-development.jpg',0,'attachment','image/jpeg',0),(10,1,'2018-03-29 12:29:28','2018-03-29 12:29:28','broadly refers to the tasks associated with developing websites for hosting via intranet or internet. The web development process includes web design, web content development, client-side/server-side scripting and network security configuration, among other tasks.','Website Design and Development','','inherit','closed','closed','','8-revision-v1','','','2018-03-29 12:29:28','2018-03-29 12:29:28','',8,'http://localhost/portfolio/index.php/2018/03/29/8-revision-v1/',0,'revision','',0),(11,1,'2018-03-29 12:32:15','2018-03-29 12:32:15','Hello! I\'m Tim Marapao and welcome to my Portfolio!\r\n\r\n<strong>Programming Quotes:</strong>\r\n\r\n\"We build our computer (systems) the way we build our cities: over time, without a plan, on top of ruins.\"\r\n<strong>- Ellen Ullman</strong>\r\n\r\n\"Every great developer you know got there by solving problems they were unqualified to solve until they actually did it.\"<strong>- Patrick McKenzie</strong>\r\n\r\nId much rather have a program explode in a shower of sparks and flames than silently do the wrong thing.\r\n<strong> -Rob Miles, The C# Programming Yellow Book</strong>\r\n\r\n\"Rules of Optimization:\r\nRule 1: Don\'t do it.\r\nRule 2 (for experts only): Don\'t do it yet. \r\n<strong>- Michael A. Jackson</strong>\r\n\r\n\"No one in the brief history of computing has ever written a piece of perfect software. It\'s unlikely that you\'ll be the first.\" <strong>- Andy Hunt</strong>\r\n\r\nJava is to JavaScript as ham is to hamster.\r\n<strong>- Jeremy Keith, Resilient Web Design</strong>\r\n<div id=\"fb-root\"></div>\r\n<script>(function(d, s, id) {\r\n						  var js, fjs = d.getElementsByTagName(s)[0];\r\n						  if (d.getElementById(id)) return;\r\n						  js = d.createElement(s); js.id = id;\r\n						  js.src = \"//connect.facebook.net/en_US/all.js#xfbml=1\";\r\n						  fjs.paren